export const REQUEST = "REQUEST";
export const RECEIVE = "RECEIVE";

export const request = (method) => (
    {
        type: REQUEST,
        method
    }
)

export const receive = (method, content) => (
    {
        type: RECEIVE,
        method,
        content
    }
);
